#! /usr/bin/python

class Solution:
    # @return an integer
    def numDistinct(self, S, T):
        m=len(S)
        n=len(T)
        C=[[0 for j in range(n)] for i in range(m)]
        for j in range(n):
            C[0][j]=0
        for i in range(m):
            C[i][0]=1
        for i in range(1,m):
            for j in range(1,n):
                C[i][j]=0
                for k in range(i):
                    if S[k+1]==T[j]:
                        C[i][j]=C[i][j]+C[k][j-1]
        return C[m-1][n-1]
            

